function MovideskHub() {
    var hubCallbacks = {};
    var movideskHubSignal = $.connection.movideskHub;

    var hubStart = function () {
        getTicketFlags();
    };

    $.connection.hub.logging = true;

    $.connection.hub.disconnected(function () {
        if ($.connection.hub.lastError) {
            console.warn("Disconnected: " + $.connection.hub.lastError.message);
        }

        setTimeout(function () {
            $.connection.hub.start().done(function () {
                hubStart();
            });
        }, 5000);
    });

    $.connection.hub.reconnected(function () {
        setTimeout(function () {
            hubStart();
        }, Math.floor(Math.random() * (180000 - 1000)) + 1000);
    });

    $.connection.hub.error(function (error) {
        console.log('SignalR error: ' + error)
    });

    $.connection.movideskHub.client.exceptionHandler = function (error) {
        console.log('MovideskHub SignalrAdapter: ' + error);
    };

    function getLogonStatus() {
        if (isConnected())
            return;

        $.ajax({
            type: "GET",
            dataType: "json",
            url: "/Home/GetLogonStatus",
            success: function (response) {
                if (!response.isAuthenticated && !location.href.match(/Login/)) {
                    redirectToLogin({ logoutType: response.logoutType });
                    return;
                }
            }
        });
    }

    // [JoinTicketGroup]
    this.receiveJoinTicketGroup = function (callback) {
        hubCallbacks.joinTicketGroup = callback;
    }

    this.sendJoinTicketGroup = function (groupName) {
        if (!this.isConnected())
            return;

        movideskHubSignal.server.joinTicketGroup(groupName);
    }

    movideskHubSignal.client.joinTicketGroup = function (ticketNumber, personId, personName) {
        hubCallbacks.joinTicketGroup && hubCallbacks.joinTicketGroup(ticketNumber, personId, personName);
    }

    // [RefreshGridTickets]
    movideskHubSignal.client.refreshGridTickets = function (result, showMessage, idTicketTab) {
        hubCallbacks.refreshGridTickets && hubCallbacks.refreshGridTickets(result, showMessage, idTicketTab);
    }

    // [GetTicketFlags]
    var _getTicketFlagsInProccess = false;

    this.receiveGetTicketFlags = function (callback) {
        hubCallbacks.getTicketFlags = callback;
    }

    function getTicketFlags() {
        if (_getTicketFlagsInProccess)
            return;

        _getTicketFlagsInProccess = true;

        $.ajax({
            type: "GET",
            dataType: "json",
            url: "/Home/GetTicketFlags",
            success: function (response) {
                hubCallbacks.getTicketFlags && hubCallbacks.getTicketFlags(response);
            }
        })
            .always(function () {
                _getTicketFlagsInProccess = false;
            })
            .fail(function (jqXHR, textStatus, errorThrown) {
                if (jqXHR.status === 0) {
                    return;
                }
                mdAjaxError(jqXHR, textStatus, errorThrown);
            });
    }

    movideskHubSignal.client.getTicketFlags = getTicketFlags;


    // [RefreshTicketFlags]
    this.receiveRefreshTicketFlags = function (callback) {
        hubCallbacks.refreshTicketFlags = callback;
    }

    movideskHubSignal.client.refreshTicketFlags = function (data) {
        hubCallbacks.refreshTicketFlags && hubCallbacks.refreshTicketFlags(data);
    }

    // [RemoveTicketFlag]
    this.receiveRemoveTicketFlag = function (callback) {
        hubCallbacks.removeTicketFlag = callback;
    }

    movideskHubSignal.client.removeTicketFlag = function (data) {
        hubCallbacks.removeTicketFlag && hubCallbacks.removeTicketFlag(data);
    }

    // [UserLogout]
    this.receiveUserLogout = function (callback) {
        hubCallbacks.userLogout = callback;
    }

    movideskHubSignal.client.userLogout = function (data) {
        hubCallbacks.userLogout && hubCallbacks.userLogout(data);
    }

    // [Remote Access - Start]

    this.remoteAccessAddSession = function (callback) {
      hubCallbacks.remoteAccessAddSession = callback;
    }

    movideskHubSignal.client.remoteAccessAddSession = function (data) {
        hubCallbacks.remoteAccessAddSession && hubCallbacks.remoteAccessAddSession(data);
    }

    this.remoteAccessRemoveSession = function (callback) {
        hubCallbacks.remoteAccessRemoveSession = callback;
    }

    movideskHubSignal.client.remoteAccessRemoveSession = function (data) {
        hubCallbacks.remoteAccessRemoveSession && hubCallbacks.remoteAccessRemoveSession(data);
    }

    this.remoteAccessAddConnection = function (callback) {
        hubCallbacks.remoteAccessAddConnection = callback;
    }

    movideskHubSignal.client.remoteAccessAddConnection = function (data) {
        hubCallbacks.remoteAccessAddConnection && hubCallbacks.remoteAccessAddConnection(data);
    }

    this.remoteAccessRemoveConnection = function (callback) {
        hubCallbacks.remoteAccessRemoveConnection = callback;
    }

    movideskHubSignal.client.remoteAccessRemoveConnection = function (data) {
        hubCallbacks.remoteAccessRemoveConnection && hubCallbacks.remoteAccessRemoveConnection(data);
    }

    this.remoteAccessClearAll = function (callback) {
        hubCallbacks.remoteAccessClearAll = callback;
    }

    movideskHubSignal.client.remoteAccessClearAll = function (data) {
        hubCallbacks.remoteAccessClearAll && hubCallbacks.remoteAccessClearAll(data);
    }

    this.joinRemoteAccessSessionGroup = function (appId) {
        if (!this.isConnected())
            return;
        movideskHubSignal.server.joinRemoteAccessSessionGroup(appId);
    }

    this.leaveRemoteAccessSessionGroup = function (appId) {
        movideskHubSignal.server.leaveRemoteAccessSessionGroup(appId);
    }
    // [Remote Access - END]

    // [Login]
    this.receiveLogin = function (callback) {
        hubCallbacks.login = callback;
    }

    movideskHubSignal.client.login = function (data) {
        hubCallbacks.login && hubCallbacks.login(data);
    }

    // [AlertOthersUserInGroup]
    this.receiveAlertOthersUserInGroup = function (callback) {
        hubCallbacks.alertOthersUserInGroup = callback;
    }

    this.sendAlertOthersUserInGroup = function (ticketNumber, personId, personName) {
        if (!this.isConnected())
            return;

        movideskHubSignal.server.alertOthersUserInGroup(ticketNumber, personId, personName);
    }

    movideskHubSignal.client.alertOthersUserInGroup = function (ticketNumber, personName) {
        hubCallbacks.alertOthersUserInGroup && hubCallbacks.alertOthersUserInGroup(ticketNumber, personName);
    }

    // [LeaveTicketGroup]
    this.receiveLeaveTicketGroup = function (callback) {
        hubCallbacks.leaveTicketGroup = callback;
    }

    this.sendLeaveTicketGroup = function (groupName, personName) {
        if (!this.isConnected())
            return;

        movideskHubSignal.server.leaveTicketGroup(groupName, personName);
    }

    movideskHubSignal.client.leaveTicketGroup = function (ticketNumber, personName) {
        hubCallbacks.leaveTicketGroup && hubCallbacks.leaveTicketGroup(ticketNumber, personName);
    }

    // [BlockTicketGroup]
    this.receiveBlockTicketGroup = function (callback) {
        hubCallbacks.blockTicketGroup = callback;
    }

    movideskHubSignal.client.blockTicketGroup = function (ticketNumber) {
        hubCallbacks.blockTicketGroup && hubCallbacks.blockTicketGroup(ticketNumber);
    }

    // [DeleteTicketGroup]
    this.receiveDeleteTicketGroup = function (callback) {
        hubCallbacks.deleteTicketGroup = callback;
    }

    movideskHubSignal.client.deleteTicketGroup = function (currentUserId) {
        hubCallbacks.deleteTicketGroup && hubCallbacks.deleteTicketGroup(currentUserId);
    }

    // [Start, Stop, IsConnected, SessionUser]
    this.sendStart = function () {
        $.connection.hub.start().done(function () { });
    }

    this.sendUpdateSessionUser = function () {
        if (!this.isConnected())
            return;

        movideskHubSignal.server.updateSessionUser();
    }

    this.sendRemoveSessionUser = function (username, domainId, host) {
        movideskHubSignal.server.removeSessionUser(username, domainId, host);
    }

    this.sendStop = function () {
        if (!this.isConnected())
            return;

        $.connection.hub.stop();
    }

    var isConnected = function () {
        return $.connection.hub.state === 1;
    }
    this.isConnected = isConnected;

    // [ShowScheduleEventReminder]
    movideskHubSignal.client.showScheduleEventReminder = function (data) {
        scheduleReminder(data.EventReminderId, data.Title, data.EventStartTime);
    }

    // [ShowPinNotification]
    movideskHubSignal.client.showPinNotification = function (id, title) {
        showPinNotification(id, title);
    }

    // [CloseActiveCall]
    this.receiveCloseActiveCall = function (callback) {
        hubCallbacks.closeActiveCall = callback;
    }

    // [CloseActiveCall]
    movideskHubSignal.client.closeActiveCall = function (callId, personId) {
        hubCallbacks.closeActiveCall && hubCallbacks.closeActiveCall(callId, personId);
    }

    // [ToggleInconsistentTriggerNotification]
    this.receiveToggleInconsistentTriggerNotification = function (callback) {
        hubCallbacks.toggleInconsistentTriggerNotification = callback;
    }

    movideskHubSignal.client.toggleInconsistentTriggerNotification = function (show) {
        hubCallbacks.toggleInconsistentTriggerNotification && hubCallbacks.toggleInconsistentTriggerNotification(show);
    }

    // [ToggleReviewTriggerNotification]
    this.receiveToggleReviewTriggerNotification = function (callback) {
        hubCallbacks.toggleReviewTriggerNotification = callback;
    }

    movideskHubSignal.client.toggleReviewTriggerNotification = function (show) {
        hubCallbacks.toggleReviewTriggerNotification && hubCallbacks.toggleReviewTriggerNotification(show);
    }

    // [ToggleNotSentEmail]
    this.receiveToggleNotSentEmail = function (callback) {
        hubCallbacks.toggleNotSentEmail = callback;
    }

    movideskHubSignal.client.toggleNotSentEmail = function (show) {
        hubCallbacks.toggleNotSentEmail && hubCallbacks.toggleNotSentEmail(show);
    }

    movideskHubSignal.client.refreshWindow = function () {
        location.reload(true);
    }

    movideskHubSignal.client.refreshAnyActiveTicketIntegration = function (any) {
        if (typeof movideskConfig === 'undefined') {
            return;
        }
        movideskConfig.anyActiveTicketIntegration = any;
    };
}
