window.hubUpdateRemoteAccessSessionQueue = function (dataIds) {
  if (++remoteAccessInQueueRequests == 5) {
    remoteAccessInQueueRequests = 0;
    // Se a aba do acesso remoto estiver aberta atualiza o contedo da lista sessoes ativas
    if (window.GetTab(".tab-remoteAccess").length)
      updateRemoteAccessQueueView(".in-queue-container", dataIds);
  }
}

