window.showMoviSchedulerNotification = function (count) {
    var menu = $('.menu-notifications');
    var notificationProcessingCenter = menu.find('.processing-center-concluded');
    var resourceNotification = String.format(resources.MsgProcessingCenterConcluded, count);

    if (notificationProcessingCenter.length == 0) {
        if (count > 0) {

            var notification = $('<li class="processing-center-concluded dropdown-item-link-movidesk">' +
                '<a href = "/ProcessingCenter" class="open-in-tab notifications-movidesk" data-force-new-tab="true" data-only-one="true" data-icon="icon-mv-cloud-download"' +
                'data-tab-title="' + resources.ProcessingCenterTitle + '" data-tab-class="tab-processing-center" data-color="Report">' +
                '<span class="icon-mv-cloud-download"></span>' +
                '<div class="dropdown-item-text-movidesk">' + resourceNotification + '</div></a ></li >');

            appendNotificationProcessingCenter(notification);
        }
    } else {
        if (count > 0) {
            notificationProcessingCenter.find('.dropdown-item-text-movidesk').html(resourceNotification);
        } else {
            notificationProcessingCenter.remove();

            if (!menu.find('.pin-received').length && !menu.find('.message-received').length) {
                menu.find('.divider-two').hide();
            }

            if (Number($('#notifications-count').text()) === 0) {
                noElementToNotification();
            }
        }
    }

    if (count > 0) {
        showNotificationPopup({
            body: strip_tags(resourceNotification),
            audioFunction: audioMovideskAlert,
            icon: '/Content/images/central_processamento.png',
            notificationType: NotificationType.processingCenter
        });
    }
}
